import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Slideshow = () => {
  const settings = {
    dots: true,
    Infinity: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScrool: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };
  return (
    <Slider {...settings}>
      <div>
        <img src="/images/slide1" alt="Slika1" />
      </div>
      <div>
        <img src="/images/slide1" alt="Slika1" />
      </div>
      <div>
        <img src="/images/slide1" alt="Slika1" />
      </div>
    </Slider>
  );
};

export default Slideshow;
